import React from 'react';
import { Parallax } from 'react-scroll-parallax'

function Header(){
    return(
    <div>
        <Parallax className="custom-class" y={[-20, 20]} tagOuter="figure">
            <h1>Ernest</h1>
        </Parallax>
        <Parallax className="custom-class" y={[-200, 200]} tagOuter="figure">
            <h1>Ho</h1>
        </Parallax>
    </div>
    );
}

export default Header;
